-- Table structure for table `solicitacao`
--

DROP TABLE IF EXISTS `solicitacao`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `solicitacao` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `data` varchar(50) DEFAULT NULL,
  `hora` varchar(50) NOT NULL,
  `destino` varchar(250) NOT NULL,
  `portaria` varchar(50) NOT NULL,
  `end_loc_ident` varchar(250) NOT NULL,
  `ida` varchar(20) DEFAULT NULL,
  `retorno` varchar(20) DEFAULT NULL,
  `cancelamento` varchar(21) DEFAULT 'NOK',
  `n_ficha` varchar(50) NOT NULL,
  `hc` varchar(15) DEFAULT NULL,
  `incor` varchar(15) DEFAULT NULL,
  `radio` varchar(20) DEFAULT NULL,
  `contato_plantao` varchar(100) DEFAULT NULL,
  `atendida_por` varchar(100) DEFAULT NULL,
  `observacao` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL,
  `status_sol` int(11) DEFAULT NULL,
  `fk_utencilios` int(11) DEFAULT NULL,
  `fk_paciente` int(11) DEFAULT NULL,
  `fk_motorista` int(11) DEFAULT NULL,
  `fk_veiculo` int(11) DEFAULT NULL,
  `fk_solicitante` int(11) DEFAULT NULL,
  `fk_dist_perc` int(11) DEFAULT NULL,
  `fk_usuario` int(11) DEFAULT NULL,
  `fk_id_ramais` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_dist` (`fk_dist_perc`),
  KEY `fk_motoristas` (`fk_motorista`),
  KEY `fk_pacientes` (`fk_paciente`),
  KEY `fk_solicitantes` (`fk_solicitante`),
  KEY `fk_veiculos` (`fk_veiculo`),
  KEY `fkUtencil` (`fk_utencilios`),
  KEY `fk_users` (`fk_usuario`),
  KEY `fk_id_ramais` (`fk_id_ramais`),
  CONSTRAINT `fkUtencil` FOREIGN KEY (`fk_utencilios`) REFERENCES `utencil` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_dist` FOREIGN KEY (`fk_dist_perc`) REFERENCES `distancia_perc` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_id_ramais` FOREIGN KEY (`fk_id_ramais`) REFERENCES `ramais` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_motoristas` FOREIGN KEY (`fk_motorista`) REFERENCES `motorista` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_pacientes` FOREIGN KEY (`fk_paciente`) REFERENCES `paciente` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_solicitantes` FOREIGN KEY (`fk_solicitante`) REFERENCES `solicitante` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_users` FOREIGN KEY (`fk_usuario`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_veiculos` FOREIGN KEY (`fk_veiculo`) REFERENCES `veiculo` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2799 DEFAULT CHARSET=utf8;
